import React from 'react';
import '../vibecheck.css';
import { Redirect } from "react-router-dom";
import Select from 'react-select';
import makeAnimated from 'react-select/animated';
import './loginsignup.css';
import axios from 'axios';

const genres = []
const animatedComponents = makeAnimated();
class Home extends React.Component {

  //the states of emotion and source will be set to null initially until the user had filled out the form.
  constructor() {
    super();
    this.state = {

    };
  }

  componentDidMount() {

  }

  hi = function (e) {

    var dataToSend = [this.state.vibe, this.state.genresSelected, this.state.chosenArtists, this.state.playlistName]
    const request = axios({
      headers: {
      'content-type': 'application/json'
      },
      method: 'post',
      url: `http://localhost:5000/newPlaylist`,
      params: {
        dataToSend
      }
    })

    alert("Since we did a manual post request with the data contained in the states, we need to manually redirect to the next page. The output will be in the python terminal.")
    e.preventDefault();
    window.location.replace("http://localhost:3000/test")
  }
  render() {


    return (
      <form action='http://localhost:5000/user' method='POST' onSubmit={this.hi}>
        <div class="login-wrap">
          <div class="login-html">
            <h1>Vibecheck</h1>
            <input id="tab-1" type="radio" name="tab" class="sign-in" />
            <label for="tab-1" class="tab">Sign In</label>
            <input id="tab-2" type="radio" name="tab" class="sign-up" />
            <label for="tab-2" class="tab">Sign Up</label>
            <div class="login-form">
              <div class="sign-in-htm">
                <div class="group">
                  <label for="user" class="label">Username</label>
                  <input   placeholder="E-mail Address" name="siun" id="user" type="text" class="input" />
                </div>
                <div class="group">
                  <label for="pass" class="label">Password</label>
                  <input   placeholder="Password" name="sipw" id="user" type="password" class="input" />
                </div>
                <div class="group">
                  <input type="submit" class="button" value="Sign In" />
                </div>
              </div>
              <div class="sign-up-htm">
                <div class="group">
                  <label for="user" class="label">First Name</label>
                  <input   placeholder="First Name" name="firstname" id="user" type="text" class="input" />
                </div>
                <div class="group">
                  <label for="user" class="label">Last Name</label>
                  <input   placeholder="Last Name" name="lastname" id="user" type="text" class="input" />
                </div>
                <div class="group">
                  <label for="pass" class="label">Password</label>
                  <input   id="pass" placeholder="Password" name="rawPassword" type="password" class="input" data-type="password" />
                </div>
                <div class="group">
                </div>
                <div class="group">
                  <label for="pass" class="label">Email Address</label>
                  <input id="pass" name="email" placeholder="E-mail Address" type="text" class="input" />
                </div>
                <div class="group">
                  <input type="submit" class="button" value="Sign Up"   />

                </div>
              </div>
            </div>
          </div>
        </div>
      </form>
    )
  }
}
export default Home;
